import React, { useEffect }  from 'react';
import { useNavigate } from 'react-router-dom';

export function App() {
  const navigate = useNavigate();
  const fun =()=>{
    if(localStorage.getItem('token') !== null)
      {
        navigate('/sign');
      }
  };
  return (
    <div >
      <button className="btn btn-primary" onClick={() => fun()}>Login</button>
    </div>
  );
}

export default App;
